import React from "react";
import PropTypes from 'prop-types';

function Nav(){
    return (
        <nav>
                <li>Home</li>
                <li>Gov.Scemes</li>
                <li>Gov.Info</li>
                <li>NewsLetter</li>
                <li>Login/SignUp</li>
                <li>FAQS</li>
                <li>App Guide</li>
            </nav> 
    )
}
Nav.PropTypes = {name: PropTypes.string}
export default Nav;
